import { useNavigate } from 'react-router-dom'
import './App.css';

function Login() {
    let navigate = useNavigate()


return (

    <div>
        <h1 className='header'>Login</h1>
        <br></br>
        <input type={"text"} placeholder="enter text" ></input><br></br>
        <input type={"text"} placeholder="enter text"></input><br></br>
        <button onClick={() => navigate('/Credit')}>เข้ำสู่ระบบ</button>    
    </div>
    
);
}

export default Login;
